import React from 'react';
import {Table} from 'reactstrap'
import axios from 'axios';

export default class App extends React.Component {
  state = {
    input: []
  }

  componentDidMount() {
    axios.get(`https://btm-rn.herokuapp.com/api/v1/users/`)
      .then(res => {
        const input = res.data.results;
        this.setState({ input });
      })
  }

  render() {
    return (
      // <ul>
      //   { this.state.input.map(val => <li>{val.name} {val.age}</li>)}
      // </ul>

    <Table dark>
          <thead>
            <tr>
              <th>ID</th>
              <th>Name</th>
              <th>Age</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <th scope="row">1</th>
              <td>Mark</td>
              <td>Otto</td>
              <td>@mdo</td>
            </tr>
            <tr>
              <th scope="row">2</th>
              <td>Jacob</td>
              <td>Thornton</td>
              <td>@fat</td>
            </tr>
            <tr>
              <th scope="row">3</th>
              <td>Larry</td>
              <td>the Bird</td>
              <td>@twitter</td>
            </tr>
          </tbody>
        </Table>
    )
  }
}
